import React, { useEffect } from 'react';
import { Routes, Route, Navigate, createBrowserRouter } from "react-router-dom";
import CAPortal from './caportal/caportal';
import EventPage from './events/eventpage';
import FaqPage from "./faqs/faqPage";
import ContactusPage from './contactus/contactusPage';
import Home from './landingpage/home';

// Define routes as an array of objects
const routes = [
  { path: "/", element: <RootComponent /> },
  { path: "/home", element: <Home /> },
  { path: "/cap-portal", element: <CAPortal /> },
  { path: "/events", element: <EventPage /> },
  { path: "/faqs", element: <FaqPage /> },
  { path: "/contact-us", element: <ContactusPage /> },
  { path: "*", element: <Navigate to="/home" /> }
];

function RootComponent() {
  useEffect(() => {
    // Redirect to '/home' when the component mounts
    window.location.href = "/home";
  }, []);

  return null; // Since this is just for redirecting, we don't need to render anything
}

const BrowserRouter = createBrowserRouter();

function App() {
  return (
    <BrowserRouter routes={routes}>
      <Routes>
        {routes.map((route, index) => (
          <Route key={index} path={route.path} element={route.element} />
        ))}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
